import styles from './post.module.css';

const Post = () => {
  return (
    <div className={styles.__post_div}>
      <div className={styles.__post_header}>
        <h3>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus lobortis eros orci, tincidunt fringilla mi.
        </h3>
      </div>
    </div>
  );
};
export default Post;
